İsmim Umm Meymune. Bir zamanlar Hol kampında esirdim ve elhamdulillah PKK eliyle yapılan zulümden kurtuldum. Beni kurtaran ismini, ülkesini ya da geldiği yeri bile bilmediğim bir kişidir. Yoldan geçen bir yabancı gibi yardım etti ve gitti. Böyle insanların olduğunu bilmek bana umut veriyor.

Sevgili hapsedilmiş kız kardeşlerim, ümmete duyduğunuz ümitten vazgeçmeyin, bu ümmetin içerisinde Allah'ın iyiliğini istedikleri var ve O onları sizin özgürlüğünüz için kullanacaktır, bana yaptığı gibi. 

Zor zamanlarda Allah'ın nuruna tutunun, istiğfar edin ve tevbeyle O'na dönün. Ve hatırlayın:

قُلْ إِنَّ صَلَاتِى وَنُسُكِى وَمَحْيَاىَ وَمَمَاتِى لِلَّهِ رَبِّ ٱلْعَٰلَمِينَ 

De ki, "Muhakkak, benim namazım, ibadetlerim, yaşamım ve ölümüm alemlerin Rabbi olan Allah içindir." 

-En'am (6:162)

